import { useState } from "react";

const MyComponent = () => {
  const [imageLoaded, setImageLoaded] = useState(false);

  const handleImageLoad = () => {
    setImageLoaded(true);
  };

  return (
    <div>
      <img src="/path/to/image.jpg" onLoad={handleImageLoad} style={{ display: "none" }} />
      {imageLoaded && (
        <div>
          <p>Other content goes here</p>
        </div>
      )}
    </div>
  );
};
